import myGames from './components/myGames';
import myShirts from "./components/myShirts";

const getViewForType = (view: number, viewModel: any) => {
	switch (view) {
		case 0:
			return myShirts(viewModel, 'Games', view);
		case 11:
		case 2: // tee shirt
		case 12:
		case 3: // audio
			return myShirts(viewModel, Type[view], view);
		default:
			return `The section specified is not available at this time.`;
	}
}


